import React, { FunctionComponent } from "react";

import { Chore } from '../interfaces/chore-interface';
import { ChoreListItem } from "./item-chore-single";


interface Props {
  chores: Chore[];
  onDelete: (chore: Chore) => void;
  key: number;
}

export const ChoresList: FunctionComponent<Props> = ({ chores, onDelete, key }) => {
  function generateKey() {
    var S4 = function() {
       return (((1+Math.random())*0x10000)|0).toString(16).substring(1);
    };
    return (S4()+S4()+"-"+S4()+"-"+S4()+"-"+S4()+"-"+S4()+S4()+S4());
  }

  return (
    <ul>
    {chores.map(chore => (
      <ChoreListItem chore={chore} onDelete={onDelete} key={generateKey()}/>
    ))}
  </ul>
  )
};
